// components/HomePage.js
import React from 'react';
import Layout from './Layout';

const HomePage = () => {
  return (
    <Layout>
    <div className="home-page">
      <h1>Welcome to the VR Landing Page</h1>
      <p>This is the home page content.</p>
    </div>
    </Layout>
  );
};

export default HomePage;
